import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Chatbot from './Pages/Chatbot'; // Import Chatbot page
import SpiriterButton from './Components/SpiriterButton'; // Import button component

function App() {
    return (
        <Router>
            <div>
                <SpiriterButton /> {/* Button to navigate to Chatbot */}
                <Routes>
                    <Route path="/chatbot" element={<Chatbot />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
